export const getProducts = () => {
return (new Promise((resolve)=>{
    setTimeout(()=>{
        resolve(products);
    }, 2000);
}))
};

export const getProductById = (id) => {
    return new Promise((resolve) => {
        setTimeout(()=>{
            resolve(products.find( e => e.id === id ));
        },2000)
    })
};


export const getProductsByCategory=(category)=>{
    return new Promise((resolve)=>{
        resolve(products.filter(e => e.category===category))
    })
};